import { useEffect, useState } from "react"

const Home = () => {
    const [prayers, setPrayers] = useState(null)

    useEffect(() => {
        const fetchPrayers = async () => {
            const res = await fetch('http://localhost:4000/api/prayers')
            const json = await res.json()

            if (res.ok) {
                setPrayers(json)
            }
        }

        fetchPrayers()
    }, [])

    return (
        <div className="home">
            <h2>HOME</h2>
        </div>
    )
}

export default Home
